import React from 'react';
import { Formik, Form, FormikHelpers } from "formik"
import FormField from '../components/Form/FromField'
import { Box, Button } from '@material-ui/core'
import { login } from '../modules/auth/authOperations'
import { connect } from 'react-redux'


type AddBankFormType = {
    handleSubmit: (values: any, actions: FormikHelpers<any>) => any
    setIsAddBank: (isOk: boolean) => void
    login: any
}

const Login: React.FC<AddBankFormType> = ({ login  }) => {
    return (
        <Box display="flex" justifyContent="center" alignItems="center" height="100vh">
            <Box>
                <Formik
                    initialValues={{
                        email: "",
                        password: ""
                    }}
                    onSubmit={async (values, actions) => {
                        // alert(JSON.stringify(values, null, 2));
                        const res = await login(values)
                        console.log('REsult', res)

                    }}
                >   
                    {(props) => (
                    <Form>
                        <Box>
                            <FormField
                                {...props}
                                name="email"
                                placeholder="email"
                                label="email"
                            />
                        </Box>
                        <Box>
                            <FormField
                                {...props}
                                name="password"
                                placeholder="password"
                                label="password"
                            />
                        </Box>
                        <Button type="submit">
                              Create entitie
                        </Button>    
                    </Form>
                    )}
                </Formik>
            </Box>
        </Box>
    );
};
const mapDispatchToProps = {
    login
}

export default connect (null, mapDispatchToProps)(Login);
